import { Navigate} from 'react-router-dom'
import Dlzc from '../pages/dlzc'
const routes = [
    {
        path: '/dlzc',
        element: <Dlzc />,
        
    },
    {
        path: '/',
        element: <Navigate to='/home' />
    }
]
export default routes
